import React from "react";
import styled from "styled-components";

const AboutWrapper = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
`;

const About = () => {
  return (
    <div className="container">
      <div className="container-wrapper">
        <AboutWrapper>
          <h2>About Me</h2>
        </AboutWrapper>
      </div>
    </div>
  );
};

export default About;
